--Data Definition and Insert Script--

--GOD_CITY_UNITS
  CREATE TABLE GOD_CITY_UNITS 
   (CITY_UNIT_CODE VARCHAR2(30) PRIMARY KEY, 
	CITY_UNIT_NAME VARCHAR2(120) , 
	START_DATE DATE, 
	PRIMARY_PHONE_NUMBER VARCHAR2(30) , 
	ALTERNATE_PHONE_NUMBER VARCHAR2(30) , 
	EMAIL_ADDRESS VARCHAR2(120) , 
	ADDRESS VARCHAR2(300) 
   ) ;



--GOD_CENTRES
 CREATE TABLE GOD_CENTRES 
   (	CITY_UNIT_CODE VARCHAR2(30), 
	CENTRE_CODE VARCHAR2(30) PRIMARY KEY, 
	CENTRE_NAME VARCHAR2(60), 
	DESCRIPTION VARCHAR2(300), 
	CENTRE_TYPE VARCHAR2(120), 
	PRIMARY_PHONE_NUMBER VARCHAR2(30), 
	ALTERNATE_PHONE_NUMBER VARCHAR2(30), 
	COORDINATOR_FLAG VARCHAR2(1), 
	COORDINATOR_PHONE_NUMBER VARCHAR2(30), 
	EMAIL_ADDRESS VARCHAR2(120), 
	ADDRESS VARCHAR2(300), 
	NUMBER_OF_RESIDENTS NUMBER(18,0), 
	NUMBER_OF_CLASSROOMS NUMBER(2,0), 
	CLASSROOM_FURNITURE_FLAG VARCHAR2(1), 
	WRITING_BOARD_TYPE VARCHAR2(30), 
	PARKING_TYPE VARCHAR2(30), 
	WATER_DISPENSER_FLAG VARCHAR2(1), 
	STATIONERY_FLAG VARCHAR2(1), 
	STORAGE_FLAG VARCHAR2(1), 
	SECURITY_FLAG VARCHAR2(1), 
	POWER_BACKUP_FLAG VARCHAR2(1), 
	MEDICAL_KIT_FLAG VARCHAR2(1), 
	GUEST_TOILET_FLAG VARCHAR2(1), 
	KITCHEN_FLAG VARCHAR2(1), 
	LAST_UPDATED VARCHAR2(120)
   )  ;
   

--GOD_BATCHES
  CREATE TABLE GOD_BATCHES 
   (BATCH_CODE VARCHAR2(30) PRIMARY KEY, 
	BATCH_NAME VARCHAR2(120), 
	CENTRE_CODE VARCHAR2(30)
   ) ;
   
   


--GOD_STUDENTS

CREATE TABLE GOD_STUDENTS 
   (CENTRE_CODE VARCHAR2(30) PRIMARY KEY, 
	BATCH_CODE VARCHAR2(30), 
	STUDENT_CODE VARCHAR2(30), 
	GENDER VARCHAR2(30), 
	FIRST_NAME VARCHAR2(60), 
	MIDDLE_NAME VARCHAR2(60), 
	LAST_NAME VARCHAR2(60), 
	BIRTH_DATE DATE, 
	SCHOOL_GRADE NUMBER(2,0), 
	NATIONAL_IDENTIFIER_FLAG VARCHAR2(1)
   );
   


--GOD_VOLUNTEERS

CREATE TABLE GOD_VOLUNTEERS 
   (CITY_UNIT_CODE VARCHAR2(30), 
	VOLUNTEER_CODE VARCHAR2(30) PRIMARY KEY, 
	FIRST_NAME VARCHAR2(60), 
	MIDDLE_NAME VARCHAR2(60), 
	LAST_NAME VARCHAR2(60), 
	EMAIL_ADDRESS VARCHAR2(120), 
	PRIMARY_PHONE_NUMBER VARCHAR2(30), 
	ALTERNATE_PHONE_NUMBER VARCHAR2(30), 
	ADDRESS VARCHAR2(300), 
	BATCH_CODE VARCHAR2(30), 
	BIRTH_DATE DATE, 
	HIRE_DATE DATE, 
	GENDER VARCHAR2(30), 
	VOLUNTEER_TYPE VARCHAR2(30), 
	ASSIGNED_PIN NUMBER(6,0)
   )  ;


--GOD_ATTENDANCE
 CREATE TABLE GOD_ATTENDANCE 
   (	VOLUNTEER_CODE VARCHAR2(30), 
	ATTENDANCE_DATE DATE, 
	BATCH_CODE VARCHAR2(30), 
	COMMENTS VARCHAR2(300)
   );   
   
  CREATE unique INDEX GOD_ATTENDANCE_U1 on GOD_ATTENDANCE (volunteer_code, batch_code, attendance_date);
   
--GOD_LOOKUPS

  CREATE TABLE GOD_LOOKUPS 
   (	LOOKUP_TYPE VARCHAR2(30), 
	LOOKUP_CODE VARCHAR2(30), 
	LOOKUP_VALUE VARCHAR2(120)
   );
   
   CREATE unique INDEX GOD_LOOKUPS_U1 on GOD_LOOKUPS (LOOKUP_TYPE, LOOKUP_CODE)
   




